import React from 'react'
import './App.css';
import {BrowserRouter as Router, Route, Routes, Navigate} from "react-router-dom";
import Heading from './Reference JS/Header';
import BodyComponent from './Reference JS/Body';
import LibraryHeading from './Library JS/LibraryHeader';
import LibraryBodyComponent from './Library JS/LibraryBody';


function App() {

  return (
    <>
      {
        <Router>
          <Routes>
            {
              <Route
                exact
                path = "/"
                element={ <div className="App">
                            <Heading />
                            <BodyComponent />
                          </div>
                        }
              />
            }
            {
              <Route 
                path="/library"
                element={ <div className="App">
                            <LibraryHeading />
                            <LibraryBodyComponent />
                          </div>
                        }
              />
            }
          </Routes>
        </Router>
      }
    </>
  );
}

export default App;
